    var checkHash = function() {
        hash = window.location.hash.toString().toLowerCase();
        var strWeBuild = 'we-build-';
        if (hash.indexOf(strWeBuild) > -1) {
            hash = hash.substring(1, hash.length);
            var isEn = ($('html')[0].lang.indexOf('en') > -1);
            var path = '/fileadmin/user_upload/we-build/';
            var cities = ['berlin', 'new-york', 'sydney', 'hamburg', 'prague'];
            var shorts = ['berlin', 'nyc', 'sydney', 'hamburg', 'prague'];
            var parts = hash.replace(strWeBuild, '').split('-');
            var strCity = parts[0] + '-' + parts[1];
            //
            for (var i = 0; i < cities.length; i++) {
                if (strCity.indexOf(cities[i]) > -1) {
                    if (wW >= navBreakpointXL && !pageBody.hasClass('touch')) {
                        var lang = (isEn) ? '-en' : '';
                        path += shorts[i] + '/' + shorts[i] + lang + '.html';
                        setCity(path, true, true, hash, shorts[i]);
                    } else {
                        var lang = (isEn) ? '/en/' : '/';
                        if (hash == strWeBuild + cities[i]) {
                            path = lang + strWeBuild + cities[i];
                        } else {
                            var proj = hash.replace(strWeBuild, '');
                            path = lang + strWeBuild + cities[i] + '#' + proj.replace(cities[i] + '-', '');
                        }
                        document.location.href = path;
                    }
                    break;
                }
            }
        } else {
            setTimeout(function() {
                var tgt = $(hash);
                if (tgt.length > 0) {
                    var y = tgt.offset().top - 40;
                    $('html, body').scrollTo(y, 400);
                }
            }, 200);
        }
    }
