    var setStage = function(stage) {
        specialStage = stage;
        specialCarousel = stage.find('.carousel');
        specialStageBackgrounds = stage.find('.stage__bg');
        specialStageCurrentSlide = 0;
        checkStageVideoOnScrollIn = true;
        checkStageVideoOnScrollOut = true;
        var overlayswitchWrapper = stage.find('.stage__overlayswitch-wrapper');
        var linkWidths = [];
        var stageVideos = [];
        var checkVideoLoad = function(slide) {
            if (!stageVideos[slide].videoLoadStarted) {
                stageVideos[slide].videoLoadStarted = true;
                stageVideos[slide].Node[0].src = stageVideos[slide].Src;
                stageVideos[slide].Node[0].load();
                stageVideos[slide].loadInterval = setInterval(function() {
                    if (stageVideos[slide].Node[0].readyState >= 3) {
                        clearInterval(stageVideos[slide].loadInterval);
                        stageVideos[slide].videoLoaded = true;
                        checkVideoPlay(slide);
                    }
                }, 100);
            }
        }
        var checkVideoPlay = function(slide) {
            if (stageVideos[slide].videoLoaded) {
                if (slide == specialStageCurrentSlide) {
                    stageVideos[slide].Node[0].play();
                }
            }
        }
        //
        specialStageBackgrounds.find('video').each(function(i, elem) {
            stageVideos[i] = [];
            stageVideos[i].Node = $(this);
            stageVideos[i].videoLoaded = false;
            stageVideos[i].videoLoadStarted = false;
            var src = $(this).children('source').attr('data-src');
            src = (window.innerWidth < navBreakpointLG) ? src.replace('.mp4', '-small.mp4') : src;
            stageVideos[i].Src = src;
        });
        specialCarousel.children('.carousel__item').each(function(i, elem) {
            var a = $(this).find('a.btn');
            a.on('click', function(e) {
                if (wW >= navBreakpointXL && !pageBody.hasClass('touch')) {
                    stopEvent(e);
                    setCity(a.attr('data-url'), true, false);
                }
            });
        });
        //
        setTimeout(function() {
            stage.find('.stage__overlayswitch-link').each(function(i, elem) {
                var a = $(this);
                p = Math.round(a.position().left);
                linkWidths.push(p);
                a.on('click', function(e) {
                    stopEvent(e);
                    specialCarousel.slick('slickGoTo', i)
                });
            });
            checkVideoLoad(0);
        }, 1000);
        specialCarousel.slick({
            slidesToScroll: 1,
            infinite: false,
            arrows: true,
            autoplay: false,
            dots: true,
            speed: 700,
            adaptiveHeight: false,
            fade: true,
            responsive: [{
                breakpoint: navBreakpointMD,
                settings: {
                    arrows: false
                }
            }]
        });
        specialCarousel.on('beforeChange', function(event, slick, currentSlide, nextSlide) {
            overlayswitchWrapper.css('transform', 'translateX(' + -1 * linkWidths[nextSlide] + 'px)');
            specialStageBackgrounds.children().each(function(i, elem) {
                if (i < nextSlide) {
                    $(this).removeClass('current').addClass('recent');
                } else if (i == nextSlide) {
                    $(this).removeClass('recent').addClass('current');
                    checkVideoLoad(nextSlide);
                } else if (i > nextSlide) {
                    $(this).removeClass('recent').removeClass('current');
                }
            });
            specialStageCurrentSlide = nextSlide;
            var n = 0;
            overlayswitchWrapper.children().each(function(i, elem) {
                $(this).removeClass('pos-0 pos-1 pos-2 pos-3 pos-4 pos-5');
                if (i == nextSlide) {
                    $(this).addClass('pos-0');
                } else if (i > nextSlide) {
                    n++;
                    $(this).addClass('pos-' + n);
                }
            });
            checkVideoPlay(specialStageCurrentSlide);
        });
        specialCarousel.on('afterChange', function(event, slick, currentSlide, nextSlide) {
            pauseStageVideos(currentSlide);
        });
        setCarouselIcons(specialCarousel);
    }
    var pauseStageVideos = function(current) {
        if (specialStageBackgrounds != null && specialStageBackgrounds != undefined) {
            specialStageBackgrounds.children().each(function(i, elem) {
                if (i != current) {
                    var video = $(this).find('video');
                    if (video.length > 0) {
                        if (video[0].readyState >= 3) {
                            video[0].pause();
                        }
                    }
                }
            });
        }
    }
    var playCurrentStageVideo = function() {
        if (specialStageBackgrounds != null && specialStageBackgrounds != undefined) {
            specialStageBackgrounds.children().each(function(i, elem) {
                if (i == specialStageCurrentSlide) {
                    var video = $(this).find('video');
                    if (video.length > 0) {
                        if (video[0].readyState >= 3) {
                            video[0].play();
                        }
                    }
                }
            });
        }
    }
