    //
    var tooltipArr = [];
    var setTooltip = function(tooltip, customtrigger) {
        var triggerMouseenter = false;
        var triggerMouseleave = false;
        var triggerClick = false;
        var triggerTap = false;
        //
        if (customtrigger) {

        } else if (pageBody.hasClass('touch')) {
            triggerClick = true;
            triggerTap = true;
        } else {
            triggerMouseenter = true;
            triggerMouseleave = true;
        }
        tooltipArr.push(tooltip);
        tooltip.tooltipster({
            theme: 'tooltipster-shadow',
            contentAsHTML: true,
            maxWidth: 600,
            interactive: true,
            delay: 100,
            distance: 6,
            side: 'bottom',
            trigger: 'custom',
            triggerOpen: {
                mouseenter: triggerMouseenter,
                click: triggerClick,
                tap: triggerTap
            },
            triggerClose: {
                mouseleave: triggerMouseleave,
                click: triggerClick,
                tap: triggerTap
            },
            functionInit: function(instance, helper) {
                var $origin = $(helper.origin);
                var dataOptions = $origin.attr('data-tooltipster');
                if (dataOptions) {
                    dataOptions = JSON.parse(dataOptions);
                    $.each(dataOptions, function(name, option) {
                        instance.option(name, option);
                    });
                }
            },
            functionReady: function(instance, helper) {

            },
            functionAfter: function(instance, helper) {
                $(helper.origin).blur();
            }
        });
    }
    var resetTooltip = function() {
        for (var i = 0; i < tooltipArr.length; i++) {
            tooltipArr[i].tooltipster('close');
        }
    }
    //
    var setPreventScroll = function(bool) {
        if (bool) {
            if (!$('html').hasClass('noscroll')) {
                if ($(document).height() > $(window).height()) {
                    pageScrollable = false;
                    var scrollTop = ($('html').scrollTop()) ? $('html').scrollTop() : $('body').scrollTop();
                    $('html').addClass('noscroll').css('top', -scrollTop);
                }
            }
        } else {
            if ($('html').hasClass('noscroll')) {
                var scrollTop = parseInt($('html').css('top'));
                $('html').removeClass('noscroll');
                $('html,body').scrollTop(-scrollTop);
                pageScrollable = true;
            }
        }
    }
