    var initNav = function() {
        var naviSubCode = '<svg class="svg-icon-next" aria-hidden="true" viewBox="0 0 16 16">' + svgP["icon-next"] + '</svg>';
        //
        pageHeaderNavMain.children('ul').children('li').each(function(i) {
            var li = $(this);
            var a = li.children('a');
            navArr[i] = [];
            navArr[i].LinkNode = a;
            navArr[i].Link = a.attr("href");
            navArr[i].breakAfterNum = a.attr("data-break-after-num");
            navArr[i].Label = a.text();
            navArr[i].hasSub = a.next().is('ul');
            navArr[i].Copy = a.siblings('div').text();
            navArr[i].LinkNode.attr("tabindex", (i + 1) * 10);
            navArr[i].LinkNode.addClass("ol-off");
            if (navArr[i].hasSub) {
                setNavArr(a.next(), navArr[i], 1, a);
                a.on('click', function(e) {
                    stopEvent(e);
                    a.toggleClass('open').parent().siblings().children('a').removeClass('open');
                    if (a.hasClass('open')) {
                        setSubnavLayer(navArr[i], 1, false, i);
                        pageBody.addClass('layermode navmode').removeClass('searchmode');
                        resetSearchCloseEvent();
                        setNavCloseEvent();
                        setPreventScroll(true);
                        setETracker(navArr[i].Label, 'Open-Subnav', 'click', '');
                    } else {
                        resetNavAndModes();
                        pageBody.addClass('fademode');
                        setTimeout(function() {
                            pageBody.removeClass('fademode');
                            resetSubnavLayer();
                        }, 500);
                    }
                });
            }
        });
        //
        var l = navArr.length;
        navArr[l] = [];
        for (var i = 0; i < l; i++) {
            navArr[l][i] = navArr[i];
            navArr[l][i].Class = '';
        }
    }
    //
    js.initJst = function(id) {
        $(id).find('.jst').each(function(i) {
            var node = $(this);
            var type = node.attr('data-jst-type');
            //
            //console.info('jst ' + [i,type])
            switch (type) {
                case 'lazy':
                    setLazy(node);
                    break;

                case 'svg-icon':
                    setSvgIcon(node);
                    break;

                case 'accordion':
                    setAccordion(node);
                    break;

                case 'carousel':
                    setCarousel(node);
                    break;

                case 'video':
                    setVideo(node, i);
                    break;

                case 'tooltip':
                    setSvgIcon(node);
                    setTooltip(node);
                    break;

                case 'search':
                    setSvgIcon(node);
                    setSvgIcon(node, 'icon-close');
                    setSearch(node);
                    break;

                case 'menu-mobile':
                    setSvgIcon(node);
                    setSvgIcon(node, 'icon-close');
                    setMenuMobile(node);
                    break;

                case 'detail':
                    setDetail(node);
                    break;

                case 'nice-select':
                    setNiceSelect(node);
                    break;

                case 'init-fancybox':
                    initFancybox(node);
                    break;

                case 'inpagemenu':
                    setInpagemenu(node);
                    break;

                case 'stage':
                    setStage(node);
                    break;

                case 'special-fp':
                    setFullpage(node);
                    break;

                case 'init-contact-select':
                    initContactSelect(node);
                    break;

                case 'countup':
                    setCountup(node, i);
                    break;

                case 'toggle':
                    setToggle(node);
                    break;

                case 'tabs':
                    setTabs(node);
                    break;

                case 'tabcarousel':
                    setTabcarousel(node);
                    break;

                case 'locations':
                    setLocations(node);
                    break;

                case 'modal':
                    setModal(node);
                    setSvgIcon(node);
                    break;

                case 'modal-btn':
                    setModal(node);
                    break;

                case 'toggle-tablerow':
                    setToggleTablerow(node);
                    break;

                case 'collapsible':
                    setCollapsible(node);
                    break;

                case 'jobsearch':
                    setJobsearch(node);
                    break;

                case 'open-special':
                    setOpenSpecial(node);
                    break;

                case 'footer-share':
                    setFooterShare(node);
                    break;

                case 'disclaimer':
                    setDisclaimer(node);
                    break;

                case 'iconlist':
                    setIconlist(node);
                    break;

                default:
                    if (node.hasClass('icon-external')) {
                        node.removeClass('svg-icon');
                        var span = $('<span class="svg-icon svg-inline-text after"></span').appendTo(node);
                        setSvgIcon(span, 'icon-external');
                    }
                    break;
            }
            //
            node.removeClass('jst').removeAttr('data-jst-type');
        });
    }
